import React from "react";
import {
  Table,
  TableBody,
  TableHead,
  TableRow,
  TableCell,
} from "@material-ui/core";
import TableTaskItem from "./TableTaskItem";

export default function TableTask() {
  return (
    <Table>
      <TableHead>
        <TableRow></TableRow>
      </TableHead>
      <TableBody>
        <TableTaskItem />
      </TableBody>
    </Table>
  );
}
